import { Text } from "domelementtype";
import { extend } from "lodash";
import React, { Component } from "react";
import TextBox from "/Users/kraken/Desktop/bulls/src/shared/Components/TextBox/TextBox.js";

class Register extends Component {
  render() {
    return (
      <div className="container p-1">

        <div className="row justify-content-center">
          <div class="col-5">
            <TextBox inputType="password" placeholder="Enter Mobile" label="Mobile Numb"/>
          </div>
        </div>

        <div className="row justify-content-center">
          <div class="col-5">
            <TextBox inputType="password" placeholder="Enter Password" label="Password"/>
          </div>
        </div>

        <div className="row justify-content-center">
          <div class="col-5">
            <label for="formGroupExampleInput2" class="form-label">
              Another label
            </label>
            <input
              type="text"
              class="form-control"
              id="formGroupExampleInput2"
              placeholder="Another input placeholder"
            />
          </div>
        </div>
      </div>
    );
  }
}

export default Register;
